The plot involves larrikin Sydney homicide detective Sergeant Scobie Malone investigating the murder of a woman whose body is found in the Sydney Opera House. In the course of his inquires, Malone discovers the woman, Helga, was a high priced prostitute involved with several important clients, including the Minister for Culture, whom she was blackmailing. Most of the police work is done by Malone's hapless offsider, leaving the title character to spend most of his screen time having sex with a bewildering variety of women, including nearly all the female inhabitants of the singles only block of flats he lives in.


